import React, { Component } from "react";

class UserGreeting extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isLoggedin: false,
    };
  }

  render() {
    return <div>Welcome Ravina</div>;
  }
}

export default UserGreeting;
